import React from "react";
import { SpinnerContainer, SpinnerOverlay } from "./withspiner.component.style";

const WithSpinner = (WrappedComponent) => ({ isF, ...otherprops }) => {
  return isLoading ? (
    <SpinnerOverlay>
      <SpinnerContainer />
    </SpinnerOverlay>
  ) : (
    <WrappedComponent {...otherprops} />
  );
};

export default WithSpinner;
